     */
     
    public function getGPXFiles($request) {
        $CODES = new Codes; 
        
        
        
        
        $result = Locations::find();
        $result->where(['is_delete'=>1]);
        
        
        if(isset($request['last_sync_on'])){
            $utcTime= CommonFacade::getUTCDateTime($request['last_sync_on'],"Y-m-d H:i:s");
            //$result->andWhere(['>=', 'modified_on', $utcTime]);
            
             $result->andFilterWhere(['or', 
                ['>=','created_on', $utcTime], 
                ['>=','modified_on', $utcTime]]);
        }
        $list = $result->all();
        
        
        if($list) {
            $docArray = array();
            $STATUS = 1;
            $CODE = $CODES::SUCCESS;
            $MSG = "";
            
            foreach($list as $ques){
                $path = \Yii::getAlias('@web') . '/uploads/'.$ques->image;
                array_push($docArray, array(
                    'id'=>$ques->type, 
                    'type'=>$ques->type0->value, 
                    'path'=>$path, 
                ));
            }
            $DATA = $docArray;
        } else {
            $STATUS = 0;
            $CODE = $CODES::ERROR;
            $MSG = $this->messages->M141;
            $DATA = array();
        }
        return array('STATUS'=>$STATUS,'CODE'=>$CODE,'MESSAGE'=>$MSG, 'DATA'=>$DATA);
    }
    
    
    function getB64Type($str) {
        return substr($str, 5, strpos($str, ';') - 5);
    }
    
    public function getImageName($placeId, $key, $extension, $randomNumber) {
        if ($extension == 'image/jpeg') {
            $name = $placeId . '-' . $key . '-' . $randomNumber .'.jpeg';
        } else if ($extension == 'image/jpg') {
            $name = $placeId . '-' . $key . '-' . $randomNumber .'.jpg';
        } else if ($extension == 'image/png') {
            $name = $placeId . '-' . $key . '-' . $randomNumber .'.png';
        }
        return $name;
    }
    
    /**
     * @author: Waseem Khan
     * @set assessment request submission
     */
      
    public function addPlace($request, $user_id) {
        $auto_id = "";
        $facade = new CommonFacade;        
        $CODES = new Codes;
        
        if(isset($request['id']) && $request['id'] != ''){
            $place = Places::find()->where(['is_delete'=>1, 'id'=>$request['id']])->one();
            $place->modified_on = $facade->getCurrentDateTime();
            $place->modified_by = $user_id;
        } else {
            $place = new Places(); 
            $place->created_on = $facade->getCurrentDateTime();
            $place->created_by = $user_id;
        }
        
        $place->status = LookupCodes::L_PLACE_STATUS_PENDING_FOR_REVIEW;
        $place->is_delete = 1;
        
        $place->attributes = $request;
        $place->phone_number = $request['phone_number'];
        
        if($place->save()){
        
            if($place->poi_type == 2000001){
                $DIR = \Yii::getAlias('@app') . '/web/uploads/places/';
                $stream = $request['brand_icon'];
                //$stream = 'data:image/jpeg;base64,';
                
                $extension = $this->getB64Type($stream);
                $randomNumber = CommonFacade::generateRandomString();

                $name = $this->getImageName($place->id, $place->poi_type, $extension, $randomNumber);

                if($extension == 'image/jpeg'){
                    $stream = str_replace("data:image/jpeg;base64,", "", $stream);
                } else if ($extension == 'image/png') {
                    $stream = str_replace("data:image/png;base64,", "", $stream);
                }


                $data = base64_decode($stream);
                $path = $DIR.'/'.$name;

                if(file_put_contents($path, $data)){
                    $docPath = $name;
                } 
                    
                $place->brand_icon = $docPath;
                $place->save();
            }
            
            
            
            if(isset($request['facilityArr']) && $request['facilityArr'] != ''){
                FacilitiesAmenities::updateAll(['is_delete' => 0, 'modified_by'=>$user_id, 'modified_on'=>$facade->getCurrentDateTime()], "place_id = $place->id");

                foreach($request['facilityArr'] as $obj){
                    $facility = FacilitiesAmenities::find()->where(['place_id'=>$place->id, 'facility_id'=>$obj])->one();
                    if(!empty($model)){
                        $facility = $model;
                    } else {
                        $facility = new FacilitiesAmenities();
                    }
                    $facility->place_id = $place->id;
                    $facility->facility_id = $obj;
                    $facility->is_delete = 1;
                    $facility->created_on = $facade->getCurrentDateTime();
                    $facility->created_by = $user_id;
                    $facility->save();
                }
            }

            $STATUS = 1;
            $CODE = $CODES::SUCCESS;
            $MSG = $this->messages->M140;   
            $auto_id = $user_id;
        } else {
            $errorAll = array_merge(array_values($place->firstErrors),array_values($place->firstErrors));
            $error = $errorAll;  
            $MSG = $error[0];
