        } 
      
             
        return array('STATUS'=>$STATUS,'CODE'=>$CODE,'MESSAGE'=>$MSG,'AUTO_ID'=>$auto_id);    
        
    }
    
    /**
     * @author: Waseem Khan
     * @set Getting searched results
     */
     
    public function searchPlaces($request, $user_id) {
        $CODES = new Codes; 
        
        $result = Places::find();
        $result->where(['status'=>2200002, 'is_delete'=>1]);
        
        if(isset($request['poiArr']) && $request['poiArr'] != ''){
            $result->andWhere(['poi_type'=>$request['poiArr']]);
        }
        
        $placeList = $result->all();
        
        
        
        if($placeList) {
            $STATUS = 1;
            $CODE = $CODES::SUCCESS;
            $MSG = "";
            $temp = array();
            foreach($placeList as $place){
                if($place->poi_type == 2000001){
                    if($place->brand_icon != ''){
                        $icon = \Yii::getAlias('@web') . '/uploads/places/'.$place->brand_icon;
                    } else {
                        $icon = '';
                    }
                    array_push($temp, array('ID'=>$place->id, 'LATITUDE'=>$place->latitude, 'LONGITUDE'=>$place->longitude, 'NAME'=>$place->name, 'ICON'=>$icon));
                } else {
                    array_push($temp, array('ID'=>$place->id, 'LATITUDE'=>$place->latitude, 'LONGITUDE'=>$place->longitude, 'NAME'=>$place->name));
                }
            }
            $DATA = $temp;
        } else {
            $STATUS = 1;
            $CODE = $CODES::SUCCESS;
            $MSG = $this->messages->M141;
            $DATA = array();
        }
        return array('STATUS'=>$STATUS,'CODE'=>$CODE,'MESSAGE'=>$MSG, 'DATA'=>$DATA);
    }
    
